    for case in test_cases:
        (N, K, events) = case
        d = [[] for _ in range(K + 0)]
        for (s_i, e_i, p_i) in events:
            d[p_i].append([s_i, e_i])
        ans = 0
        for room_events in d:
            if len(room_events) == 0:
                continue
            ans += 1
            t = sorted(room_events, key=lambda x: (x[1], x[0]))
            final = t[0][1]
            for j in range(1, len(t)):
                if t[j][0] >= final:
                    ans += 1
                    final = t[j][1]
        results.append(ans)
    return results

